import React from 'react';
import './Header.css';
import california from '../images/icons8-california-50 (2).png'


export default function Header(){
    return (
    <div className="header">
        <header className="header-box">
            <h1 className="header-text"><img src={california} alt="california"/>find your park</h1>
        </header>
    </div>
    )
}
